  \"2016-03-17T20:51:48.621669\",\n\t\"name\": \"oral-health-emergency-department-visits\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"There are three measures available on the
  portal for oral health emergency department visits:rnrn1.  Number of Visits u2013
  The count of emergency department visits with a principle diagnosis code for oral
  health.rn2.  Crude Rate per 10,000 u2013 Rate calculated by dividing the number
  of cases by the total census population and multiplying by 10,000.rn3.  Age Adjusted
  Rate per 10,000k u2013 Age adjustment to the 2000 Standard US Census to allow direct
  comparison of rates in counties or states with different age distributions.rnrnThis
  indicator uses data collected by hospitals and outpatient clinics. It can be used
  to identify trends and patterns in the occurrence of oral health problems across
  time and space. The data are organized by different variables to help estimate the
  burden of oral health in different time periods, age groups, and geographic areas.rnrnOral
  health-related emergency department visits are measured through outpatient records
  when service is provided in the emergency department or observation area of hospitals
  and clinics, and through inpatient hospitalization records when the patient is admitted
  through the emergency department or observation area.\",\n\t\"license_title\": \"License
